description:
And a mixed multitude went up also with them. In this multitude were not only those who were actuated by faith in the God of Israel, but also a far GREATER NUMBER who desired only to escape from the plagues, or who followed in the wake of the moving multitudes merely from excitement and curiosity. This class were ever a HINDRANCE and a SNARE to Israel. {PP 281.2}
It was the mixed multitude that came from Egypt with the Israelites who were the PRINCIPAL MOVERS in this dreadful departure from God. They were called a mixed multitude, because the Hebrews had INTERMARRIED with the Egyptians. {1SP 243.1}
"By conforming to the practices of paganism, to facilitate the acceptance of Christianity by the heathen...To secure converts, the exalted standard of the Christian faith was lowered, and as the result a pagan flood, flowing into the church, carried with it its customs, practices, and idols..." {GC 384.5}
